  render() {
    return (
      //JSX
      <div className="App">
        <h1>Hi, I'm React App.</h1>
        <p>This is really working!!!</p>
        <Person name="Suraj" age="24" />
        <Person name="Susan" age="18" />
      </div>
    );


    //Children means 'all' that are nested in between this <div></div>
    //creating elements with 4 arguments. 
